import React, { Component } from "react";
import '../../App.css';
import LeftDrawer from '../Drawer/Drawer';
import * as videoStyles from  "../../styles/video";


class Home extends Component {

    constructor(props){
        super(props);       
    }
 
  


    render() {
        var date = (new Date().getMonth() + 1) + "/" + new Date().getDate() + "/" + new Date().getFullYear();
        var location = "San Jose";
        var camera = "Camera #1";

        return (
        <div style={videoStyles.background}>
         
           
            <div style={videoStyles.videoContainer} >
            <LeftDrawer></LeftDrawer>
            <div style={videoFrame}>
                <iframe style={videoStyles.video} src='https://www.liveflightapp.com/embed?key=b1371aa1-dea8-41cd-af74-8fda634b3a5d' width='100%;' height='500px;' frameborder='0' scrolling='no'></iframe>
            </div>
              {/*   <iframe style={videoStyles.video} width="700px" height="400px" src="https://295-videos.s3.us-east-2.amazonaws.com/San-Jose-16th-Oct-2019.mp4"></iframe> */}
                <div style = {videoStyles.videoInfo}><h5> Date: {date} &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Location: {location} &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Camera: {camera}</h5></div>
              
            </div>
   
        </div> 

        );
    }
}



export default Home;
